@namespace url(http://www.w3.org/1999/xhtml);
@-moz-document domain("play.google.com") {

body { font-family: Calibri !important}

.music-banner, .nav-bar, #breadcrumbs {
  background-color: #3b5998 !important;
  height: 47px !important;
}

#volume_slider, #played_slider, #time_container_current {
  background-color: #3b5998 !important;
}

#headerBar .tab-text {
  color: #ffffff !important;
}
  
.button.small, .button.primary, .simple-dialog-buttons button.goog-buttonset-default {
  color: white !important;
  background-color: #555577 !important;
  border-radius: 3px !important;
  border: 1px solid rgba(0,0,0,.17) !important;
}

.button.small:hover, .button.primary:hover, .simple-dialog-buttons button.goog-buttonset-default:hover {
  background-color: #333355 !important;
  box-shadow: inset 0 -2px 0 rgba(0,0,0,.27) !important;
  border-radius: 3px !important;
}

#extra-links-anchor {
  background: no-repeat url("data:images/png;base64,") !important;
}

.extra-links-dropdown {
  background: no-repeat url("data:images/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAgAAAAICAYAAADED76LAAAABmJLR0QAAAAAAAD5Q7t/AAAACXBIWXMAAAsTAAALEwEAmpwYAAAAB3RJTUUH3QsbDRkEBgm6jAAAAB1pVFh0Q29tbWVudAAAAAAAQ3JlYXRlZCB3aXRoIEdJTVBkLmUHAAAAQUlEQVQY02NgoAr4//9/+3/sYBpMAeP///+XoElu/P//PzOyKWz////fC5U88f//fy5sVvH///9/2////6UZqAYATthPob7257wAAAAASUVORK5CYII=") !important;
}

#action_bar_container button[data-id="shuffle-my-library"] .icon {
  background: no-repeat url("data:images/png;base64,") !important;
  opacity: 1 !important;
}

#action_bar_container button[data-id="im-feeling-lucky"] .icon {
  background: no-repeat url("data:images/png;base64,") !important;
  opacity: 1 !important;
}

.goog-slider-track .goog-slider-thumb {
  background: no-repeat url("data:images/png;base64,") !important;
}

#slider .played-progress {background: #3b5998 !important;}
    
#player .flat-button[data-id="repeat"][value="SINGLE_REPEAT"] {
  background: no-repeat url("data:images/png;base64,") !important;
}
      
#player .flat-button[data-id="repeat"][value="LIST_REPEAT"] {
  background: no-repeat url("data:images/png;base64,") !important;
}
    
#player .flat-button[data-id="shuffle"][value="ALL_SHUFFLE"] {
  background: no-repeat url("data:images/png;base64,") !important;
}

#player .rating-container.stars .background {
  background: url("data:image/png;base64,") left center repeat-x !important;
}    
#player .flat-button[data-id="queue"] {
  background: url("data:image/png;base64,") left center repeat-x !important;
}    

#extra-links-container div {
  opacity: 1 !important;
}

.header-tab-title.selected {
  color: #ffffff !important;
  border-bottom: 3px solid #333355 !important;
}
.header-tab-title:hover {
  background-color: rgba(255,255,255,0.05) !important;
}

.header-tab-title {
  color: #dddddd !important;
}

#nav_collections .nav-item-container.selected, #nav_collections .nav-item-container.selected:focus, .nav-item-container.selected, .nav-item-container.selected:focus, .empty-library-header {
  color: #3b5998 !important;
}

#current-loading-progress {background: #3b5998 !important;}

}
